import React from 'react';
import Navbar from './'
import { MDBCard,MDBCardHeader, MDBCardBody, MDBCardTitle, MDBCardText, MDBRow, MDBCol, MDBIcon, MDBContainer} from 'mdbreact';

const ColleagueProfile = (props) => {
    return (
    <MDBContainer>
        <MDBCard className="mb-3">
            <MDBCardHeader color="primary-color" tag="h3">
                <MDBCardTitle><img src="https://bootdey.com/img/Content/avatar/avatar7.png" alt="Admin" class="rounded-circle" width="50"></img>  {props.details.name}</MDBCardTitle>
            </MDBCardHeader>
            <MDBCardBody>
                {props.details.company}
                <MDBCardText>Portfolio: https://bootdey.com</MDBCardText>
                <MDBCardText>
                    <MDBCol md='12' className='d-flex justify-content-center'>
                        <a href='!#' className='px-2 fa-lg li-ic'>
                            <MDBIcon fab icon='linkedin-in'></MDBIcon>
                        </a>
                        <a href='!#' className='px-2 fa-lg fb-ic'>
                            <MDBIcon fab icon='instagram'></MDBIcon>
                        </a>
                        <a href='!#' className='px-2 fa-lg tw-ic'>
                            <MDBIcon fab icon='twitter'></MDBIcon>
                        </a>
                        <a href='!#' className='px-2 fa-lg fb-ic'>
                            <MDBIcon fab icon='facebook-f'></MDBIcon>
                        </a>
                    </MDBCol>
                </MDBCardText>
                <MDBCardText>
                    <a href='!#' className='mt-1 d-flex justify-content-end align-items-center'>
                        <h5 className=''>Read more{' '}
                            <MDBIcon icon='chevron-right' className='ml-2' size='sm'></MDBIcon>
                        </h5>
                    </a>
                </MDBCardText>
            </MDBCardBody>
        </MDBCard>
    </MDBContainer>
    );
    };
function Colleague(){
    return (
        <MDBContainer>
            <MDBRow>
                <ColleagueProfile details={{name:'Hrujul Thumar',company:"Deutsche Bank"}}></ColleagueProfile>
                <ColleagueProfile details={{name:'Jeel Baraiya',company:"Google"}}></ColleagueProfile>
                <ColleagueProfile details={{name:'Raj Gondalia',company:"Microsoft"}}></ColleagueProfile>
           </MDBRow>
        </MDBContainer>
    );
}

export default Colleague;
